column36:
Partiu para a Casa do Pai o nosso querido Padre António Pedro Boto de Oliveira.
05.02.1971 - 05.01.2022

Exéquias na Igreja de Santa Catarina
Dia 5
16h30 - Início do velório na Igreja de Santa Catarina;
18h00 - Oração do Terço;
19h00 - Missa;
21h30 - Ofício de Defuntos.

Dia 6 
8h00 - Oração do Terço;
9h30 - Missa de Corpo Presente presidida pelo Sr. Cardeal-Patriarca D. Manuel Clemente;
11h00 - Saída para o Cemitério dos Olivais.

Por vontade do Padre Pedro pedimos o favor de não oferecerem flores.
Pede-se que façam um donativo na igreja e o valor será entregue a famílias apoiadas pelo Centro Social e Paroquial de Santa Catarina.

A começar o ano da melhor forma possível! ✨

Hoje foi dia da ALC Dance Studios participar no programa da Praça da Alegria 🤩

Gratos à Sónia Araújo e ao Jorge Gabriel por nos receberem sempre com tanto carinho! 🥰

Muitos parabéns ao professor Ricardo Amoêdo e à Catarina Barbosa pela fantástica mini aula e pela atuação final 👏👏

